import React from "react";
import clsx from "clsx";
import './index.css';

export default function Button(props) {
    const { children, outline, className, ...rest } = props;

    const classNames = clsx(
        {
            btn: true,
            "btn-default": !outline,
            "btn-outline": outline,
        },
        className
    );

    return(
        <button className={className} {...rest}>{children}</button>
    );
}
